import React from "react";
import "./Home.css";
function Home() {
  return (
    <div className="home">
      <img
        className="home__image"
        src="https://m.media-amazon.com/images/G/01/digital/video/sonata/ROW_FR_TVOD_Hero_Elcano_Multi_Title_Store_Aug_V2/f105e944-5c7e-4bb9-aaad-61219eca2b41._UR3000,600_SX1500_FMjpg_.jpg"
        alt="prime image"
      />
      <h1></h1>
    </div>
  );
}

export default Home;
